import React from 'react';
import './CompletionStatus.css';
import grey_line from '../assets/line.png';

const CompletionStatus = ({ mealManagement, quizCompletion }) => {
  return (
    <div className="completion-status">
      <div className="status-item">
        <div>식사관리완료</div>
        <div className="count">{mealManagement}회</div>
      </div>
      <div className="divider"></div>
      <div className="status-item">
        <div>퀴즈 완료</div>
        <div className="count">{quizCompletion}회</div>
      </div>
    </div>
  );
};

export default CompletionStatus;
